pragma solidity ^0.8.0;

contract AttendanceContract {
    
    event AttendanceUploaded(string fileName, address sender);

    mapping (address => mapping(string => bool)) attendanceRecords;

    function uploadAttendance(string memory fileName) public {
        require(bytes(fileName).length > 0, "File name cannot be empty");
        require(!attendanceRecords[msg.sender][fileName], "Attendance already uploaded for this file name");

        attendanceRecords[msg.sender][fileName] = true;
        emit AttendanceUploaded(fileName, msg.sender);
    }

    function checkAttendance(address studentAddress, string memory fileName) public view returns (bool) {
        return attendanceRecords[studentAddress][fileName];
    }
}
